BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "ActiviteNIV1" (
	"Code"	TEXT,
	"Libelle"	TEXT
);
CREATE TABLE IF NOT EXISTS "ActiviteNIV2" (
	"Code"	INTEGER,
	"Libelle"	TEXT
);
CREATE TABLE IF NOT EXISTS "ActiviteNIV3" (
	"Code"	REAL,
	"Libelle"	TEXT
);
CREATE TABLE IF NOT EXISTS "ActiviteNIV4" (
	"Code"	REAL,
	"Libelle"	TEXT
);
CREATE TABLE IF NOT EXISTS "ActiviteNIV5" (
	"Code"	TEXT,
	"Libelle"	TEXT
);
CREATE TABLE IF NOT EXISTS "ActiviteNiveau" (
	"NIV5"	TEXT,
	"NIV4"	REAL,
	"NIV3"	REAL,
	"NIV2"	INTEGER,
	"NIV1"	TEXT
);
CREATE TABLE IF NOT EXISTS "EffectifsCode" (
	"code"	VARCHAR(2),
	"description"	TEXT NOT NULL,
	PRIMARY KEY("code")
);
CREATE TABLE IF NOT EXISTS "Etablissement" (
	"siret"	INTEGER PRIMARY KEY,
	"trancheEffectifsEtablissement"	TEXT,
	"numeroVoieEtablissement"	TEXT,
	"typeVoieEtablissement"	TEXT,
	"libelleVoieEtablissement"	TEXT,
	"codePostalEtablissement"	INTEGER,
	"libelleCommuneEtablissement"	TEXT,
	"enseigne1Etablissement"	TEXT,
	"activitePrincipaleEtablissement"	TEXT
);
CREATE TABLE IF NOT EXISTS "Geolocalisation" (
	"siret"	INTEGER PRIMARY KEY,
	"y_latitude"	REAL,
	"x_longitude"	REAL
);
CREATE TABLE IF NOT EXISTS "Users" (
	"id"	INTEGER,
	"username"	VARCHAR(255) NOT NULL UNIQUE,
	"email"	VARCHAR(255) NOT NULL,
	"password"	VARCHAR(255) NOT NULL,
	"role"	TEXT DEFAULT 'USER',
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "sqlite_stat4" (
	"tbl"	,
	"idx"	,
	"neq"	,
	"nlt"	,
	"ndlt"	,
	"sample"	
);
COMMIT;
